import React, { useState } from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  const [visible, setVisible] = useState(false);

  const handleMouseEnter = () => {
    setVisible(true);
  };

  const handleMouseLeave = () => {
    setVisible(false);
  };

  return (
    <nav className={`navbar ${visible ? 'visible' : 'hidden'}`}>
      <div className="top-area" onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}></div>
      <ul>
        <li><Link to="aboutMe" smooth={true} duration={500}>About Me</Link></li>
        <li><Link to="qualifications" smooth={true} duration={500}>My Qualifications</Link></li>
        <li><Link to="journey" smooth={true} duration={500}>My Journey</Link></li>
        <li><Link to="projects" smooth={true} duration={500}>Projects</Link></li>
        <li><Link to="hobbies" smooth={true} duration={500}>Hobbies</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
